import React from 'react';

export default function LeftPanel() {
  return (
    <div className="left-panel">
      <div className="search">Search conversations</div>
      <div className="convo-list">
        <div className="convo active">
          <div className="avatar">B</div>
          <div className="meta">
            <div className="name">Bot</div>
            <div className="last">Last message preview...</div>
          </div>
        </div>
        <div className="convo">
          <div className="avatar">A</div>
          <div className="meta">
            <div className="name">Alice</div>
            <div className="last">Hey! Are you free today?</div>
          </div>
        </div>
      </div>
    </div>
  );
}
